    playbackData.comments = {"ev-0":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-0","timestamp":1599236366361,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-1","timestamp":1612642931832,"commentText":"<div>Javascript developers are implementing lots of business logic and storing the associated data for that logic in the front end using javascript. This involves a lot of manual manipulation of the DOM to make it match the data in the app. <br></div><div><br></div><div><a href=\"https://reactjs.org/\">React</a> lets you build your UI in small components that can be composed together. This is ideal compared to building complex apps with just the DOM and a group of functions. Each small component might have some data associated with it. When the data changes, React automatically re-renders the component and all of its children. This simplifies the flow of control and behavior in a Single Page App (SPA).</div><br>This program shows how to create a very simple React component. A React component generates one or more html elements. I will use A CDN to pull in the React library in this example. I'll call methods in that library to render different components in an html file. There are a few different ways to create elements but in this example I'll use a function to create a very simple component. The function will generate an html element and that new element will be placed in the DOM by React.<br><br>I start with a simple Hello World!!! component and then change it to be a more generic and reusable custom header component. Along the way I show how to use the <font face=\"Courier\">createElement</font> method and then how to use JSX for specifying more complex components.","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"","linesBelow":"","currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-529":[{"id":"commentId-1","displayCommentEvent":{"id":"ev-529","timestamp":1546557501188,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":529,"type":"INSERT","fileId":"fileId-0","character":"\n","previousNeighborId":"ev-528","lineNumber":10,"column":33,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612643114479,"commentText":"<div>I will not be using an express app for this program. It will consist solely of html/javascript code that can run in the browser. I start with a single html file called index.html. This file includes the bootstrap style sheet and a bootstrap <font face=\"Courier\">container</font>.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"<link rel=\"stylesheet\" href=\"https://stackpath.bootstrapcdn.com/bootstrap/4.1.3/css/bootstrap.min.css\" integrity=\"sha384-MCw98/SFnGE8fJT3GXwEOngsV7Zt27NXFoaoApmYm81iuXoPkFOJwJ8ERdknLPMO\" crossorigin=\"anonymous\">","startRow":6,"startColumn":8,"endRow":6,"endColumn":219},{"fileId":"fileId-0","selectedText":"class=\"container\"","startRow":9,"startColumn":13,"endRow":9,"endColumn":30}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"6","linesBelow":"4","currentFilePath":"/index.html","viewableBlogText":"<!DOCTYPE html> \n<html> \n    <head> \n        <meta charset=\"utf-8\"/> \n        <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\" /> \n        <title>React App</title>  \n        <link rel=\"stylesheet\" href=\"https://stackpath.bootstrapcdn.com/bootstrap/4.1.3/css/bootstrap.min.css\" integrity=\"sha384-MCw98/SFnGE8fJT3GXwEOngsV7Zt27NXFoaoApmYm81iuXoPkFOJwJ8ERdknLPMO\" crossorigin=\"anonymous\"> \n    </head> \n    <body> \n        <div class=\"container\"> \n \n        </div> \n    </body> \n</html> ","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-756":[{"id":"commentId-2","displayCommentEvent":{"id":"ev-756","timestamp":1546557521014,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":756,"type":"INSERT","fileId":"fileId-0","character":"\r","previousNeighborId":"ev-489","lineNumber":14,"column":15,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612643238684,"commentText":"Next, I add a <font face=\"Courier\">div</font> where the main react component will go. It has an <font face=\"Courier\">id</font> attribute set to <font face=\"Courier\">app</font> so that it can be selected in some javascript code.<div><br></div><div>In a moment I will ask the React library to find this <font face=\"Courier\">div</font> and place a new html element inside of it. React will manage that DOM manipulation for me.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"<div id=\"app\"> \n                <!-- Main react component will go here --> \n            </div>","startRow":10,"startColumn":12,"endRow":12,"endColumn":18}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"2","currentFilePath":"/index.html","viewableBlogText":"    <body> \n        <div class=\"container\"> \n            <div id=\"app\"> \n                <!-- Main react component will go here --> \n            </div> \n        </div>  \n    </body> ","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-1170":[{"id":"commentId-3","displayCommentEvent":{"id":"ev-1170","timestamp":1546557660423,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1170,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-1169","lineNumber":16,"column":8,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612643339994,"commentText":"Next, I add a script at the bottom of the <font face=\"Courier\">body</font> tag. In it I use an object from the React library called <font face=\"Courier\">ReactDOM</font> to render some html in the page by manipulating the page's DOM. This is part of the React library and its job is to build and manage html elements for me.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"ReactDOM.render(","startRow":19,"startColumn":12,"endRow":19,"endColumn":28},{"fileId":"fileId-0","selectedText":");","startRow":22,"startColumn":12,"endRow":22,"endColumn":14}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"11","linesBelow":"2","currentFilePath":"/index.html","viewableBlogText":"    <body> \n        <div class=\"container\"> \n            <div id=\"app\"> \n                <!-- Main react component will go here --> \n            </div> \n        </div> \n \n        <script src=\"https://unpkg.com/react@15/dist/react.js\"></script> \n        <script src=\"https://unpkg.com/react-dom@15/dist/react-dom.js\"></script> \n \n        <script> \n            ReactDOM.render( \n                React.createElement(\"h1\", {}, \"Hello World!!!\"), \n                document.getElementById(\"app\") \n            ); \n        </script> \n    </body> ","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-4","displayCommentEvent":{"id":"ev-1170","timestamp":1546557660423,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1170,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-1169","lineNumber":16,"column":8,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612643465624,"commentText":"The <font face=\"Courier\">render</font> method takes two parameters. The first is a React generated element. There is an object called <font face=\"Courier\">React</font>&nbsp;in the library that has a method that will dynamically create an html element for me.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"React.createElement(","startRow":20,"startColumn":16,"endRow":20,"endColumn":36},{"fileId":"fileId-0","selectedText":")","startRow":20,"startColumn":62,"endRow":20,"endColumn":63}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"12","linesBelow":"4","currentFilePath":"/index.html","viewableBlogText":"    <body> \n        <div class=\"container\"> \n            <div id=\"app\"> \n                <!-- Main react component will go here --> \n            </div> \n        </div> \n \n        <script src=\"https://unpkg.com/react@15/dist/react.js\"></script> \n        <script src=\"https://unpkg.com/react-dom@15/dist/react-dom.js\"></script> \n \n        <script> \n            ReactDOM.render( \n                React.createElement(\"h1\", {}, \"Hello World!!!\"), \n                document.getElementById(\"app\") \n            ); \n        </script> \n    </body> ","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-5","displayCommentEvent":{"id":"ev-1170","timestamp":1546557660423,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1170,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-1169","lineNumber":16,"column":8,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612643535823,"commentText":"The second parameter to the <font face=\"Courier\">render</font> method is where the element should go. I am using the built-in <font face=\"Courier\">document</font> object's <font face=\"Courier\">getElementById</font> method to retrieve the <font face=\"Courier\">div</font> I defined in the html. The new element will be placed inside the <font face=\"Courier\">div</font> with the id <font face=\"Courier\">app</font>.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"document.getElementById(\"app\") ","startRow":21,"startColumn":16,"endRow":21,"endColumn":47}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"13","linesBelow":"3","currentFilePath":"/index.html","viewableBlogText":"    <body> \n        <div class=\"container\"> \n            <div id=\"app\"> \n                <!-- Main react component will go here --> \n            </div> \n        </div> \n \n        <script src=\"https://unpkg.com/react@15/dist/react.js\"></script> \n        <script src=\"https://unpkg.com/react-dom@15/dist/react-dom.js\"></script> \n \n        <script> \n            ReactDOM.render( \n                React.createElement(\"h1\", {}, \"Hello World!!!\"), \n                document.getElementById(\"app\") \n            ); \n        </script> \n    </body> ","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-6","displayCommentEvent":{"id":"ev-1170","timestamp":1546557660423,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1170,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-1169","lineNumber":16,"column":8,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612643648050,"commentText":"The React object's <font face=\"Courier\">createElement</font> method takes three parameters:<div>- the type of element that the react library should create (in this case an <font face=\"Courier\">h1</font>)</div><div>- an object of attributes to set on the element (I am not adding any attributes to the <font face=\"Courier\">h1</font> yet)</div><div>- one or more child elements (in other words, all of the things to put in the <font face=\"Courier\">h1</font>, I am adding some text)</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"\"h1\", {}, \"Hello World!!!\"","startRow":20,"startColumn":36,"endRow":20,"endColumn":62}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"2","currentFilePath":"/index.html","viewableBlogText":"            ReactDOM.render( \n                React.createElement(\"h1\", {}, \"Hello World!!!\"), \n                document.getElementById(\"app\") \n            ); ","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-7","displayCommentEvent":{"id":"ev-1170","timestamp":1546557660423,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1170,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-1169","lineNumber":16,"column":8,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612643755459,"commentText":"You might be wondering how I am accessing anything from the React library since my project directory only holds this one file. I include a script reference to the <font face=\"Courier\">React</font> and <font face=\"Courier\">ReactDOM</font> libraries. This is the simplest way to start using React but it is not very efficient since the page will download the entire library and execute this code every time the page is served.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"<script src=\"https://unpkg.com/react@15/dist/react.js\"></script> \n        <script src=\"https://unpkg.com/react-dom@15/dist/react-dom.js\"></script>","startRow":15,"startColumn":8,"endRow":16,"endColumn":80}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"7","linesBelow":"8","currentFilePath":"/index.html","viewableBlogText":"    <body> \n        <div class=\"container\"> \n            <div id=\"app\"> \n                <!-- Main react component will go here --> \n            </div> \n        </div> \n \n        <script src=\"https://unpkg.com/react@15/dist/react.js\"></script> \n        <script src=\"https://unpkg.com/react-dom@15/dist/react-dom.js\"></script> \n \n        <script> \n            ReactDOM.render( \n                React.createElement(\"h1\", {}, \"Hello World!!!\"), \n                document.getElementById(\"app\") \n            ); \n        </script> \n    </body> ","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-8","displayCommentEvent":{"id":"ev-1170","timestamp":1546557660423,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1170,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-1169","lineNumber":16,"column":8,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612643857416,"commentText":"If you use your browser to open this html file with control-O (windows) or command-O (mac) you should see an identical page that is in the attached screenshot.<div><br><div>You can see that React injected an <font face=\"Courier\">h1</font> with the text \"Hello World!!!\" in the <font face=\"Courier\">div</font> with the <font face=\"Courier\">id</font> of \"<font face=\"Courier\">app</font>\". It did this because the <font face=\"Courier\">ReactDOM.render</font> method went and found the <font face=\"Courier\">div</font> and created an <font face=\"Courier\">h1</font> element to put inside of it.</div></div><div><br></div><div>Note: I am using Firefox in this example because Chrome does not allow you to run a React app like this when it is served from the file system. Firefox does allow it. In future React playbacks I'll use a server to serve the files.</div>","selectedCodeBlocks":[],"imageURLs":["media/images/1612643797062-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/index.html","viewableBlogText":"","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-1192":[{"id":"commentId-9","displayCommentEvent":{"id":"ev-1192","timestamp":1546557772209,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1192,"type":"INSERT","fileId":"fileId-0","character":"\"","previousNeighborId":"ev-1191","lineNumber":21,"column":65,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612644054514,"commentText":"The second parameter to <font face=\"Courier\">createElement</font> is an object where you can specify some attributes to the element being created. Here I add the bootstrap class <font face=\"Courier\">display-4</font> to the <font face=\"Courier\">h1</font> that is being created. The attached screenshot shows the new, more modern looking <font face=\"Courier\">h1</font>.<div><br></div><div>Note: since this is javascript code the html attribute <font face=\"Courier\">class</font> cannot be used because it is a javascript keyword. Instead, use <font face=\"Courier\">className</font> when specifying an html class like this.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"{className: \"display-4\"}","startRow":20,"startColumn":42,"endRow":20,"endColumn":66}],"imageURLs":["media/images/1612643933557-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"2","currentFilePath":"/index.html","viewableBlogText":"            ReactDOM.render( \n                React.createElement(\"h1\", {className: \"display-4\"}, \"Hello World!!!\"), \n                document.getElementById(\"app\") \n            ); ","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-1217":[{"id":"commentId-10","displayCommentEvent":{"id":"ev-1217","timestamp":1546557813058,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1217,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-1216","lineNumber":21,"column":68,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612644307919,"commentText":"Next, I add a new <font face=\"Courier\">style</font> property to the object. The value is another object that specifies a particular style that you might see in a style sheet. I want the <font face=\"Courier\">h1</font>'s foreground color to be green. This will change the color of the text. The attached screenshot shows the new look. You can use css style sheets instead of setting styles manually in this object.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"style: {color: \"green\"}","startRow":20,"startColumn":43,"endRow":20,"endColumn":66}],"imageURLs":["media/images/1612644263581-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"2","currentFilePath":"/index.html","viewableBlogText":"            ReactDOM.render( \n                React.createElement(\"h1\", {style: {color: \"green\"}, className: \"display-4\"}, \"Hello World!!!\"), \n                document.getElementById(\"app\") \n            ); ","commentTags":["image"],"questionCommentData":null,"commentTitle":""},{"id":"commentId-11","displayCommentEvent":{"id":"ev-1217","timestamp":1546557813058,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1217,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-1216","lineNumber":21,"column":68,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612644355640,"commentText":"I want to recreate the beginning of the CS Legends page that I have been building throughout this book. Next, I will change what I have to make it look like that page.<br>","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/index.html","viewableBlogText":"","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-1385":[{"id":"commentId-12","displayCommentEvent":{"id":"ev-1385","timestamp":1546557992842,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1385,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-1384","lineNumber":21,"column":197,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612644475554,"commentText":"<div>In order to do this I'll create an <font face=\"Courier\">h1</font> with the text \"Computer Science Legends\" and the bootstrap class <font face=\"Courier\">display-3</font>. <br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"\"h1\", {className: \"display-3\"}, \"Computer Science Legends\"","startRow":20,"startColumn":36,"endRow":20,"endColumn":94}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"2","currentFilePath":"/index.html","viewableBlogText":"            ReactDOM.render( \n                React.createElement(\"h1\", {className: \"display-3\"}, \"Computer Science Legends\", React.createElement('p', {className: 'lead'}, 'This is a page to hold information about CS legends.')), \n                document.getElementById(\"app\") \n            ); ","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-13","displayCommentEvent":{"id":"ev-1385","timestamp":1546557992842,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1385,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-1384","lineNumber":21,"column":197,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612644627756,"commentText":"If you recall from the previous examples I also had a paragraph tag with the bootstrap class <font face=\"Courier\">lead</font>. It turns out that the <font face=\"Courier\">React.createElement</font> method can take any number of child elements after the element type and attribute objects.&nbsp;<div><br></div><div>So, if I want a paragraph to be added I can call <font face=\"Courier\">createElement</font> again right after the text for the <font face=\"Courier\">h1</font>. The attached screenshot shows the new page.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"React.createElement('p', {className: 'lead'}, 'This is a page to hold information about CS legends.')","startRow":20,"startColumn":96,"endRow":20,"endColumn":197}],"imageURLs":["media/images/1612644533177-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"2","currentFilePath":"/index.html","viewableBlogText":"            ReactDOM.render( \n                React.createElement(\"h1\", {className: \"display-3\"}, \"Computer Science Legends\", React.createElement('p', {className: 'lead'}, 'This is a page to hold information about CS legends.')), \n                document.getElementById(\"app\") \n            ); ","commentTags":["image"],"questionCommentData":null,"commentTitle":""},{"id":"commentId-14","displayCommentEvent":{"id":"ev-1385","timestamp":1546557992842,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1385,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-1384","lineNumber":21,"column":197,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612644909814,"commentText":"I can use a comma separated list of child elements and add as many as I'd like. However, you can probably already tell that this will be a pain and lead to some pretty ugly code. There is a better way.<div><div><br></div><div>React allows you to specify complex hierarchical tag relationships with JSX. This is an XML-like syntax for specifying how elements relate to each other. In addition, I'll offload the creation of the component to a function in the next step.</div></div>","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/index.html","viewableBlogText":"","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-2004":[{"id":"commentId-15","displayCommentEvent":{"id":"ev-2004","timestamp":1546558302911,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2004,"type":"INSERT","fileId":"fileId-0","character":">","previousNeighborId":"ev-2003","lineNumber":24,"column":32,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612644976408,"commentText":"I will create a custom component that displays the heading for my CS Legends page. In React, one way to create a component is to define a function that returns some JSX (I will use classes to create components in later playbacks). Here I have created a new file, CustomHeader.js, to hold this function called <font face=\"Courier\">CustomHeader</font>.","selectedCodeBlocks":[{"fileId":"fileId-1","selectedText":"unction CustomHeader()","startRow":0,"startColumn":1,"endRow":0,"endColumn":23}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"7","currentFilePath":"/CustomHeader.js","viewableBlogText":"function CustomHeader() { \n    return ( \n        <div> \n            <h1 className=\"display-3\">Computer Science Legends</h1> \n            <p className=\"lead\">This is a page to hold information about CS legends.</p> \n        </div> \n    ); \n}","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-16","displayCommentEvent":{"id":"ev-2004","timestamp":1546558302911,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2004,"type":"INSERT","fileId":"fileId-0","character":">","previousNeighborId":"ev-2003","lineNumber":24,"column":32,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612645049040,"commentText":"The function returns some JSX. JSX was created by the React team to simplify composing components together. This JSX looks a lot like plain old html. I have created a <font face=\"Courier\">div</font> with an <font face=\"Courier\">h1</font> and a paragraph tag. Remember, though this is inside of a javascript function. All component functions must returns some JSX.","selectedCodeBlocks":[{"fileId":"fileId-1","selectedText":"<div> \n            <h1 className=\"display-3\">Computer Science Legends</h1> \n            <p className=\"lead\">This is a page to hold information about CS legends.</p> \n        </div>","startRow":2,"startColumn":8,"endRow":5,"endColumn":14}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"2","currentFilePath":"/CustomHeader.js","viewableBlogText":"function CustomHeader() { \n    return ( \n        <div> \n            <h1 className=\"display-3\">Computer Science Legends</h1> \n            <p className=\"lead\">This is a page to hold information about CS legends.</p> \n        </div> \n    ); \n}","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-17","displayCommentEvent":{"id":"ev-2004","timestamp":1546558302911,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2004,"type":"INSERT","fileId":"fileId-0","character":">","previousNeighborId":"ev-2003","lineNumber":24,"column":32,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612645090741,"commentText":"I am returning this JSX from my component function. The way JSX works is that you can only return a single containing element but it can have as many children elements as needed. Here I am returning the <font face=\"Courier\">div</font> which contains the other elements. The parentheses after the return are to make the code more readable.","selectedCodeBlocks":[{"fileId":"fileId-1","selectedText":"return (","startRow":1,"startColumn":4,"endRow":1,"endColumn":12},{"fileId":"fileId-1","selectedText":");","startRow":6,"startColumn":4,"endRow":6,"endColumn":6}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"1","currentFilePath":"/CustomHeader.js","viewableBlogText":"function CustomHeader() { \n    return ( \n        <div> \n            <h1 className=\"display-3\">Computer Science Legends</h1> \n            <p className=\"lead\">This is a page to hold information about CS legends.</p> \n        </div> \n    ); \n}","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-18","displayCommentEvent":{"id":"ev-2004","timestamp":1546558302911,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2004,"type":"INSERT","fileId":"fileId-0","character":">","previousNeighborId":"ev-2003","lineNumber":24,"column":32,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612645164654,"commentText":"JSX is not something that browsers understand. There is a tool called <i>Babel</i> which will convert all JSX code into calls to <font face=\"Courier\">React.createElement</font>. In order to use Babel I can retrieve a copy from the same content distribution network where I am getting the React code.&nbsp;","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"<script src=\"https://unpkg.com/babel-standalone@6/babel.min.js\"></script> ","startRow":17,"startColumn":8,"endRow":17,"endColumn":82}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"0","currentFilePath":"/index.html","viewableBlogText":"        <script src=\"https://unpkg.com/react@15/dist/react.js\"></script> \n        <script src=\"https://unpkg.com/react-dom@15/dist/react-dom.js\"></script> \n        <script src=\"https://unpkg.com/babel-standalone@6/babel.min.js\"></script> ","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-19","displayCommentEvent":{"id":"ev-2004","timestamp":1546558302911,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2004,"type":"INSERT","fileId":"fileId-0","character":">","previousNeighborId":"ev-2003","lineNumber":24,"column":32,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612645270390,"commentText":"Next, I have to tell Babel which code to compile. I can do this by adding a new script tag with the type \"text/babel\". Now, the file CustomHeader.js will be retrieved from the file system and sent through Babel to convert that JSX code into calls to <font face=\"Courier\">createElement</font>.<div><br></div><div><font face=\"Courier\">createElement</font> is difficult to use manually if there are a lot of nested components inside each other. The Babel compiler converts all of that friendly JSX into calls to <font face=\"Courier\">createElement</font>. It writes all of that messy code so I don't have to.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"<script type=\"text/babel\" src=\"CustomHeader.js\"></script>","startRow":19,"startColumn":8,"endRow":19,"endColumn":65}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"4","linesBelow":"7","currentFilePath":"/index.html","viewableBlogText":"        <script src=\"https://unpkg.com/react@15/dist/react.js\"></script> \n        <script src=\"https://unpkg.com/react-dom@15/dist/react-dom.js\"></script> \n        <script src=\"https://unpkg.com/babel-standalone@6/babel.min.js\"></script> \n         \n        <script type=\"text/babel\" src=\"CustomHeader.js\"></script> \n \n        <script type=\"text/babel\"> \n            ReactDOM.render( \n                <CustomHeader />, \n                document.getElementById(\"app\") \n            ); \n        </script> ","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-20","displayCommentEvent":{"id":"ev-2004","timestamp":1546558302911,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2004,"type":"INSERT","fileId":"fileId-0","character":">","previousNeighborId":"ev-2003","lineNumber":24,"column":32,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612645361399,"commentText":"I will do the same with my script in index.html because I am making a change to use JSX in the call to <font face=\"Courier\">render</font> as well.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"script type=\"text/babel\"","startRow":21,"startColumn":9,"endRow":21,"endColumn":33}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"13","linesBelow":"6","currentFilePath":"/index.html","viewableBlogText":"    <body> \n        <div class=\"container\"> \n            <div id=\"app\"> \n                <!-- Main react component will go here --> \n            </div> \n        </div> \n \n        <script src=\"https://unpkg.com/react@15/dist/react.js\"></script> \n        <script src=\"https://unpkg.com/react-dom@15/dist/react-dom.js\"></script> \n        <script src=\"https://unpkg.com/babel-standalone@6/babel.min.js\"></script> \n         \n        <script type=\"text/babel\" src=\"CustomHeader.js\"></script> \n \n        <script type=\"text/babel\"> \n            ReactDOM.render( \n                <CustomHeader />, \n                document.getElementById(\"app\") \n            ); \n        </script> \n    </body> ","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-21","displayCommentEvent":{"id":"ev-2004","timestamp":1546558302911,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2004,"type":"INSERT","fileId":"fileId-0","character":">","previousNeighborId":"ev-2003","lineNumber":24,"column":32,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612645540050,"commentText":"Now that I changed the script's type from the default of javascript to Babel I can use JSX syntax to create my custom component. When Babel sees a tag that starts with an uppercase letter it will assume I want to use a custom component (JSX elements that start with a lowercase letter are assumed to be plain old html elements). It will look for a function with the name <font face=\"Courier\">CustomHeader</font>, call it, and return the element created from JSX.<div><br></div><div>If you run the program now you will see a nearly identical page as before. The only problem is that this is not really a custom header. It can only be used in my CS Legend app. I'll make the component more reusable next.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"<CustomHeader />","startRow":23,"startColumn":16,"endRow":23,"endColumn":32}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"15","linesBelow":"4","currentFilePath":"/index.html","viewableBlogText":"    <body> \n        <div class=\"container\"> \n            <div id=\"app\"> \n                <!-- Main react component will go here --> \n            </div> \n        </div> \n \n        <script src=\"https://unpkg.com/react@15/dist/react.js\"></script> \n        <script src=\"https://unpkg.com/react-dom@15/dist/react-dom.js\"></script> \n        <script src=\"https://unpkg.com/babel-standalone@6/babel.min.js\"></script> \n         \n        <script type=\"text/babel\" src=\"CustomHeader.js\"></script> \n \n        <script type=\"text/babel\"> \n            ReactDOM.render( \n                <CustomHeader />, \n                document.getElementById(\"app\") \n            ); \n        </script> \n    </body> ","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-2210":[{"id":"commentId-22","displayCommentEvent":{"id":"ev-2210","timestamp":1546558385277,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2210,"type":"INSERT","fileId":"fileId-1","character":"}","previousNeighborId":"ev-2209","lineNumber":5,"column":42,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612645612690,"commentText":"A React component function can have 'props' or properties. These are immutable values sent in to the function and used to create the user interface returned from the function. For this component, every custom header needs a <font face=\"Courier\">title</font> and <font face=\"Courier\">subtitle</font>.","selectedCodeBlocks":[{"fileId":"fileId-1","selectedText":"{title, subtitle}","startRow":0,"startColumn":22,"endRow":0,"endColumn":39}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"7","currentFilePath":"/CustomHeader.js","viewableBlogText":"function CustomHeader({title, subtitle}) { \n    return ( \n        <div> \n            <h1 className=\"display-3\">{title}</h1> \n            <p className=\"lead\">{subtitle}</p> \n        </div> \n    ); \n}","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-23","displayCommentEvent":{"id":"ev-2210","timestamp":1546558385277,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2210,"type":"INSERT","fileId":"fileId-1","character":"}","previousNeighborId":"ev-2209","lineNumber":5,"column":42,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612645703716,"commentText":"The function's parameters are called <font face=\"Courier\">title</font> and <font face=\"Courier\">subtitle</font>. I can go from JSX mode back to plain javascript by using a set of curly braces inside the JSX. Babel will use the values of the parameters when creating the elements.<div><br></div><div>The highlighted code says to take the values of <font face=\"Courier\">title</font> and <font face=\"Courier\">subtitle</font> and place them in the <font face=\"Courier\">h1</font> and <font face=\"Courier\">p</font> tags respectively.&nbsp;</div><div><br></div><div>Now this component can be reused in different places or even in React different apps.</div>","selectedCodeBlocks":[{"fileId":"fileId-1","selectedText":"title","startRow":3,"startColumn":39,"endRow":3,"endColumn":44},{"fileId":"fileId-1","selectedText":"subtitle","startRow":4,"startColumn":33,"endRow":4,"endColumn":41}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"3","linesBelow":"3","currentFilePath":"/CustomHeader.js","viewableBlogText":"function CustomHeader({title, subtitle}) { \n    return ( \n        <div> \n            <h1 className=\"display-3\">{title}</h1> \n            <p className=\"lead\">{subtitle}</p> \n        </div> \n    ); \n}","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-24","displayCommentEvent":{"id":"ev-2210","timestamp":1546558385277,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2210,"type":"INSERT","fileId":"fileId-1","character":"}","previousNeighborId":"ev-2209","lineNumber":5,"column":42,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612645807806,"commentText":"The props are defined in the JSX like this. Babel will make a new object that looks like this:<div><br></div><div><font face=\"Courier\">{</font></div><div><font face=\"Courier\">&nbsp; &nbsp; title: \"Computer Science Legends\",</font></div><div><font face=\"Courier\">&nbsp; &nbsp; subtitle: \"This is a page to hold information about CS legends.\"</font></div><div><font face=\"Courier\">}</font></div><div><br></div><div>and it will pass it into the function to be used.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"title=\"Computer Science Legends\" subtitle=\"This is a page to hold information about CS legends.\"","startRow":23,"startColumn":30,"endRow":23,"endColumn":126}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"2","currentFilePath":"/index.html","viewableBlogText":"            ReactDOM.render( \n                <CustomHeader title=\"Computer Science Legends\" subtitle=\"This is a page to hold information about CS legends.\"/>, \n                document.getElementById(\"app\") \n            ); ","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-25","displayCommentEvent":{"id":"ev-2210","timestamp":1546558385277,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2210,"type":"INSERT","fileId":"fileId-1","character":"}","previousNeighborId":"ev-2209","lineNumber":5,"column":42,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612646018939,"commentText":"Let me explain this set of curly braces in the parameter list. This is an example of 'object destructuring' in javascript. This says to create two parameters for the function called <font face=\"Courier\">title</font> and <font face=\"Courier\">subtitle</font>. These parameters will get their values from the props object passed in to the function.<br><br>Recall that this object will be created by Babel and sent in to the <font face=\"Courier\">CustomHeader</font> function:<br><br><font face=\"Courier\">{<br>&nbsp;&nbsp;&nbsp; title: \"Computer Science Legends\",<br>&nbsp;&nbsp;&nbsp; subtitle: \"This is a page to hold information about CS legends.\"<br>}</font><br><br>With destructuring the parameters are matched by name to properties in the passed in object. <br><br>In other words, since the passed in object has a property called <font face=\"Courier\">title</font> the parameter with the same name will get the value \"Computer Science Legends\". The same is true with the <font face=\"Courier\">subtitle</font> parameter. The parameter list is filled in from values from the object. <br>","selectedCodeBlocks":[{"fileId":"fileId-1","selectedText":"{","startRow":0,"startColumn":22,"endRow":0,"endColumn":23},{"fileId":"fileId-1","selectedText":"}","startRow":0,"startColumn":38,"endRow":0,"endColumn":39}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"7","currentFilePath":"/CustomHeader.js","viewableBlogText":"function CustomHeader({title, subtitle}) { \n    return ( \n        <div> \n            <h1 className=\"display-3\">{title}</h1> \n            <p className=\"lead\">{subtitle}</p> \n        </div> \n    ); \n}","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-26","displayCommentEvent":{"id":"ev-2210","timestamp":1546558385277,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2210,"type":"INSERT","fileId":"fileId-1","character":"}","previousNeighborId":"ev-2209","lineNumber":5,"column":42,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612646126102,"commentText":"<div>The object destructuring is optional. It is perfectly ok to just accept the <font face=\"Courier\">props</font> object as is. The only difference is that you have to use dot notation to retrieve the properties:<br></div><div>&nbsp;</div><div><font face=\"Courier\">function CustomHeader(props) {</font></div><div><font face=\"Courier\">&nbsp; &nbsp; return (</font></div><div><font face=\"Courier\">&nbsp; &nbsp; &nbsp; &nbsp; &lt;div&gt;</font></div><div><font face=\"Courier\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;h1 className=\"display-3\"&gt;{props.title}&lt;/h1&gt;</font></div><div><font face=\"Courier\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;p className=\"lead\"&gt;{props.subtitle}&lt;/p&gt;</font></div><div><font face=\"Courier\">&nbsp; &nbsp; &nbsp; &nbsp; &lt;/div&gt;</font></div><div><font face=\"Courier\">&nbsp; &nbsp; );</font></div><div><font face=\"Courier\">}</font></div><div><br></div><div>In the original call to createElement() the second argument was the <b>props</b> object.</div><div><br></div><div>The two approaches are equivalent. Having said that, most React developers choose to destructure their props.</div>","selectedCodeBlocks":[{"fileId":"fileId-1","selectedText":"{title, subtitle}","startRow":0,"startColumn":22,"endRow":0,"endColumn":39},{"fileId":"fileId-1","selectedText":"{title}","startRow":3,"startColumn":38,"endRow":3,"endColumn":45},{"fileId":"fileId-1","selectedText":"{subtitle}","startRow":4,"startColumn":32,"endRow":4,"endColumn":42}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"3","currentFilePath":"/CustomHeader.js","viewableBlogText":"function CustomHeader({title, subtitle}) { \n    return ( \n        <div> \n            <h1 className=\"display-3\">{title}</h1> \n            <p className=\"lead\">{subtitle}</p> \n        </div> \n    ); \n}","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-2667":[{"id":"commentId-27","displayCommentEvent":{"id":"ev-2667","timestamp":1546558451459,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2667,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-2666","lineNumber":30,"column":12,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612646283239,"commentText":"To prove that this is a reusable component I'll add another custom header on the same page. First I'll create another <font face=\"Courier\">div</font> with a different id, <font face=\"Courier\">app2</font>, underneath the original in index.html.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"<div id=\"app2\"> \n                <!-- Another react component will go here --> \n            </div>","startRow":13,"startColumn":12,"endRow":15,"endColumn":18}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"5","linesBelow":"20","currentFilePath":"/index.html","viewableBlogText":"    <body> \n        <div class=\"container\"> \n            <div id=\"app\"> \n                <!-- Main react component will go here --> \n            </div> \n            <div id=\"app2\"> \n                <!-- Another react component will go here --> \n            </div>             \n        </div> \n \n        <script src=\"https://unpkg.com/react@15/dist/react.js\"></script> \n        <script src=\"https://unpkg.com/react-dom@15/dist/react-dom.js\"></script> \n        <script src=\"https://unpkg.com/babel-standalone@6/babel.min.js\"></script> \n         \n        <script type=\"text/babel\" src=\"CustomHeader.js\"></script> \n \n        <script type=\"text/babel\"> \n            ReactDOM.render( \n                <CustomHeader title=\"Computer Science Legends\" subtitle=\"This is a page to hold information about CS legends.\"/>, \n                document.getElementById(\"app\") \n            ); \n             \n            ReactDOM.render(  \n                <CustomHeader title=\"Bowling Legends\" subtitle=\"Let's Bowl!\" />,  \n                document.getElementById('app2') \n            );             \n        </script> \n    </body> ","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-28","displayCommentEvent":{"id":"ev-2667","timestamp":1546558451459,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2667,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-2666","lineNumber":30,"column":12,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612646341725,"commentText":"Then I'll create another instance of a custom header but I will pass in different values for the props. The attached screenshot shows the output.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"ReactDOM.render(  \n                <CustomHeader title=\"Bowling Legends\" subtitle=\"Let's Bowl!\" />,  \n                document.getElementById('app2') \n            );","startRow":30,"startColumn":12,"endRow":33,"endColumn":14}],"imageURLs":["media/images/1612646335460-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"6","linesBelow":"1","currentFilePath":"/index.html","viewableBlogText":"        <script type=\"text/babel\"> \n            ReactDOM.render( \n                <CustomHeader title=\"Computer Science Legends\" subtitle=\"This is a page to hold information about CS legends.\"/>, \n                document.getElementById(\"app\") \n            ); \n             \n            ReactDOM.render(  \n                <CustomHeader title=\"Bowling Legends\" subtitle=\"Let's Bowl!\" />,  \n                document.getElementById('app2') \n            );             \n        </script> ","commentTags":["image"],"questionCommentData":null,"commentTitle":""},{"id":"commentId-29","displayCommentEvent":{"id":"ev-2667","timestamp":1546558451459,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":2667,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-2666","lineNumber":30,"column":12,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1612646407879,"commentText":"In this playback I have showed how to:<div>- use <font face=\"Courier\">ReactDOM.render</font> to create a component in a web page</div><div>- create an html element using <font face=\"Courier\">React.createElement</font></div><div>- use JSX to simplify element creation including how to create custom elements</div><div>- use props to send data into a component function</div><div><br></div><div>Next, I'll show how to create more complex components to recreate the entire CS Legends site.</div>","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/index.html","viewableBlogText":"","commentTags":[],"questionCommentData":null,"commentTitle":""}]};
